import React from "react";
import { AppBar, CardMedia, Toolbar } from "@mui/material";

export const MuiAppBar = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <CardMedia height="20" image="./src/images/logo512.png" alt="Webink" />
      </Toolbar>
    </AppBar>
  );
};
